import perplexityLogo from "../Images/perplexityLogo.png"
import React, { useState } from 'react';


const Right = () => {
    const [selected, setSelected] = useState("perplexity");

  const handleChange = (e) => {
    setSelected(e.target.value);
  };
    return (
      <div style={{width:"319px", margin:"24px"}}>
        <div>
            <div>
            <div style={{ position: "relative", width: "220px", marginTop: "20px" }}>
      <label style={{ fontSize: "16px", marginBottom: "8px", display: "block" }}>
        AI Module
      </label>
      <div
        style={{
          display: "flex",
          alignItems: "center",
          backgroundColor: "#FAFAFA",
          border: "1px solid #ccc",
          borderRadius: "8px",
          padding: "8px 12px",
          cursor: "pointer",
          position: "relative",
        }}
      >
        {selected === "perplexity" && (
          <img
            src={perplexityLogo}
            alt="perplexity"
            style={{ width: "20px", height: "20px", marginRight: "8px" }}
          />
        )}
        <select
          value={selected}
          onChange={handleChange}
          style={{
            flex: 1,
            border: "none",
            backgroundColor: "transparent",
            fontSize: "16px",
            color: "#333",
            // WebkitAppearance: "none",
            // MozAppearance: "none",
            paddingRight: "24px",
            cursor: "pointer",
          }}
        >
          <option value="perplexity">Perplexity</option>
          <option value="gpt-4">GPT-4</option>
          <option value="gemini-pro">Gemini Pro</option>
          <option value="claude-3">Claude 3</option>
        </select>

        {/* Custom dropdown arrow
        <div style={{ position: "absolute", right: "12px", pointerEvents: "none" }}>
          â–¼
        </div> */}
      </div>
    </div>

            </div>

        </div>

        <div style={{fontSize:"20px", marginTop:"45px"}}>
            Collections
        </div>
        <div style={{fontSize:"20px", marginTop:"45px"}}>
            Saved
        </div>
      </div>
    );
  };

  export default Right;
